import { Header } from "./Header";
import { Paper, Stack } from "@mui/material";
import { ButtonClick } from "./ButtonClick";
import { TextInput } from "./TextInput";
import setBodyColor from "./setBody";
import makeStyles from "@mui/styles/makeStyles/makeStyles";

export const SignIn = () => {
  const classes = useStyles();

  setBodyColor({ color: "#DDFFF7" });
  return (
    <div>
      <Header />
      <Paper elevation={2} className={classes.form}>
        <h1 className={classes.title}>Registration form</h1>
        <Stack spacing={2} direction="row" className={classes.formContainer}>
          <Stack spacing={2} direction="column">
            <TextInput label="Email" type="email" fullwidth={true} />
            <TextInput label="Password" type="password" fullwidth={true} />
          </Stack>
        </Stack>
        <Stack
          className={classes.submitButtonStack}
          spacing={2}
          direction="row"
          justifyContent="center"
        >
          <ButtonClick
            type="submit"
            variant="contained"
            color="#FFA69E"
            size="large"
          >
            Sumbit
          </ButtonClick>
        </Stack>
      </Paper>
    </div>
  );
};

const useStyles = makeStyles({
  title: {
    display: "flex",
    justifyContent: "center",
  },
  form: {
    width: "600px",
    margin: "auto",
    marginTop: "150px",
    padding: "60px",
  },
  formContainer: {
    display: "flex",
    justifyContent: "center",
    alignItems: "center",
  },
  submitButtonStack: {
    marginTop: "12px",
  },
});
